import { createGlobalStyle } from "styled-components";

const GlobalStyles = createGlobalStyle`
@import url('https://fonts.googleapis.com/css2?family=Chakra+Petch:wght@500&family=League+Spartan:wght@500;600;700&family=Montserrat&display=swap');

body {
  font-family: 'League Spartan', sans-serif;
  font-size: 12px;
}
`;

export default GlobalStyles;
